// # 1717. Maximum Score From Removing Substrings
// https://leetcode.com/problems/maximum-score-from-removing-substrings/

struct Solution;

impl Solution {
    pub fn maximum_gain(s: String, x: i32, y: i32) -> i32 {
        println!("s: {}, x: {}, y: {}", &s, x, y);

        let rx = "ab";
        let ry = "ba";
        let mut sum = 0;

        let replace = |input: String, replace: &str| {
            let mut chars: Vec<char> = Vec::new();

            let (c1, c2) = (
                replace.chars().nth(0).unwrap(),
                replace.chars().nth(1).unwrap(),
            );

            for c in input.chars() {
                if c == c2 && !chars.is_empty() && c1 == chars[chars.len() - 1] {
                    chars.pop();
                } else {
                    chars.push(c);
                }
            }

            chars.iter().collect::<String>()
        };

        if x < y {
            let len = s.len();
            let s = replace(s, ry);
            sum += y * (len - s.len()) as i32 / 2;

            let len = s.len();
            let s = replace(s, rx);
            sum += x * (len - s.len()) as i32 / 2;
        } else {
            let len = s.len();
            let s = replace(s, rx);
            sum += x * (len - s.len()) as i32 / 2;

            let len = s.len();
            let s = replace(s, ry);
            sum += y * (len - s.len()) as i32 / 2;
        }

        sum
    }

    // Time Limit Exceeded
    pub fn _maximum_gain(s: String, x: i32, y: i32) -> i32 {
        println!("s: {}, x: {}, y: {}", &s, x, y);

        let rx = "ab";
        let ry = "ba";
        let mut s = s;
        let mut sum = 0;

        if x < y {
            loop {
                if s.contains(&ry) {
                    s = s.replacen(&ry, "", 1);
                    sum += y;
                    continue;
                }
                if s.contains(&rx) {
                    s = s.replacen(&rx, "", 1);
                    sum += x;
                    continue;
                }
                break;
            }
        } else {
            loop {
                if s.contains(&rx) {
                    s = s.replacen(&rx, "", 1);
                    sum += x;
                    continue;
                }
                if s.contains(&ry) {
                    s = s.replacen(&ry, "", 1);
                    sum += y;
                    continue;
                }
                break;
            }
        }

        sum
    }
}

#[cfg(test)]
mod tests {
    use crate::medium::maximum_score_from_removing_substrings::Solution;

    #[test]
    fn test_maximum_gain_1() {
        let s = "cdbcbbaaabab".to_owned();
        let x = 4;
        let y = 5;
        assert_eq!(19, Solution::maximum_gain(s, x, y));
    }

    #[test]
    fn test_maximum_gain_2() {
        let s = "aabbaaxybbaabb".to_owned();
        let x = 5;
        let y = 4;
        assert_eq!(20, Solution::maximum_gain(s, x, y));
    }

    #[test]
    fn test_maximum_gain_3() {
        let s = "".to_owned();
        let x = 3998;
        let y = 564;
        assert_eq!(56045452, Solution::maximum_gain(s, x, y));
    }
}
